import React, {Component} from 'react';
//import {Router, Link} from "react-router-dom";
import {Row} from "react-bootstrap";
import {Col} from "react-bootstrap";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faPhone } from '@fortawesome/free-solid-svg-icons';
import { faAddressBook } from '@fortawesome/free-solid-svg-icons';
import { faUser } from '@fortawesome/free-solid-svg-icons';

class HeaderLinks extends Component {
    render() {
        return (
            <Row>
                <Col xs={6}>
                    <a href="#"><FontAwesomeIcon icon={faPhone} />+90 555 111 11 00</a>
                </Col>
                <Col className={'float-left'} xs={6}>
                    <a href="#"><FontAwesomeIcon icon={faAddressBook} />Login</a>
                    <a href="#"><FontAwesomeIcon icon={faUser} />Register</a>
                    <a href="#"><FontAwesomeIcon icon={faPhone} />Favorites</a>
                </Col>
            </Row>
        );
    }
}

export default HeaderLinks;
